import logo from './logo.svg';
import './App.css';
import data from './data';

function App() {
  return (
    <div>
      <header>
        <a href='/'>amazona</a>
      </header>
      <main>
        <h1>list products</h1>
        {
          data.products.map(product => (<div>
            <img src={product.image} alt={product.name} />
            <p></p>
          </div>)

          )
        }
      </main>
    </div>
  );
}

export default App;
